B.R5=new A.hH("Hello! I'm Thijs Pirmez, an app developer with a passion for creating innovative solutions. My journey into software development began as a self-taught Android developer\u2014initially a hobby that evolved into a fulfilling career. Prior to venturing into the world of coding, I worked as a technician in wind turbines and held roles as a Project Manager and R&D engineer in the automotive industry. It was during my time as an R&D engineer that I encountered Android development. The moment I started exploring Java and Android Studio, I found myself captivated, dedicating nearly all my free time to mastering the art of developing Android applications.",null,B.iP,null,null)
B.R6=new A.hH("While I did not pursue software engineering at the university level, I hold two bachelor's degrees. The first in Mechanical Engineering and Production Technology, which I completed in 2012, and the second in Energy Technology, earned in 2014. Although my interest in software development was always present, it wasn't until later in life that I realized it was a passion I wanted to pursue professionally. Subsequently, I embarked on a journey of self-education, undertaking numerous online courses with a primary focus on app development. My goal was to accumulate sufficient knowledge to secure a position as an app developer. This transformative journey commenced in 2021, and by 2023, I achieved a significant milestone: receiving my first job offer as an app developer!",null,B.wl,null,null)
